import React from 'react';
import Carousel from 'react-bootstrap/Carousel';

import Img1 from './Img1.jpg'
import Img2 from './Img2.jpg'
import Img3 from './Img3.jpg'
import Img4 from './Img4.jpg'

function Carousels() {
  return (
    <Carousel>
      <Carousel.Item>
        <img className="img_carousel" src={Img2} alt="First" />
      </Carousel.Item>

      <Carousel.Item>
        <img className="img_carousel" src={Img3} alt="Second"  />
      </Carousel.Item>

      <Carousel.Item>
        <img  className="img_carousel"src={Img4} alt="Third" />
      </Carousel.Item>
      
    </Carousel>
  );
}

export default Carousels;
